export class Track extends Component {
  render() {
    return (
        <Svg
            height="6"
            width={this.props.width}
        >
            <Line
                y="3"
                x1="0"
                y1="0"
                x2="100%"
                y2="0"
                stroke="#6d6d6d"
                strokeWidth="2"
            />
            <Circle
                cx="3"
                cy="3"
                r="3"
                fill="#6d6d6d"
            />
            <Circle
                cx="3"
                cy="3"
                r="3"
                x={this.props.width - 6}
                fill="#6d6d6d"
            />
            { this.props.status == 6 ?
                this.props.language == 'he' ?
                <G>
                <Line
                    y="3"
                    x1="100%"
                    y1="0"
                    x2={(100 - this.props.percent) + '%'}
                    y2="0"
                    stroke="url(#grad)"
                    strokeWidth="2"
                />
                <Circle
                    cx="3"
                    cy="3"
                    r="3"
                    x={this.props.width - 6}
                    fill="#D80000"
                />
                <Circle
                    cx="3"
                    cy="3"
                    r="3"
                    x={((this.props.width / 100) * (100 - this.props.percent)) - 6}
                    fill="#F24A4A"
                />
                <LinearGradient id="grad" x1="0" y1="0" x2="53" y2="0">
                    <Stop offset="0" stopColor="#F24A4A" stopOpacity="1" />
                    <Stop offset="1" stopColor="#D80000" stopOpacity="1" />
                </LinearGradient>
                </G> :
                <G>
                <Line
                    y="3"
                    x1="0"
                    y1="0"
                    x2={this.props.percent + '%'}
                    y2="0"
                    stroke="url(#grad)"
                    strokeWidth="2"
                />
                <Circle
                    cx="3"
                    cy="3"
                    r="3"
                    fill="#D80000"
                />
                <Circle
                    cx="3"
                    cy="3"
                    r="3"
                    x={((this.props.width / 100) * this.props.percent) - 6}
                    fill="#F24A4A"
                />
                <LinearGradient id="grad" x1="0" y1="0" x2="53" y2="0">
                    <Stop offset="0" stopColor="#D80000" stopOpacity="1" />
                    <Stop offset="1" stopColor="#F24A4A" stopOpacity="1" />
                </LinearGradient>
                </G>
                : null
            }
        </Svg>
    )
  }
}

